import React from "react";
import "./Subtotal.css";
import CurrencyFormate from "react-currency-format";

function Subtotal() {
  return (
    <div className="subtotal">
      {/* price */}
      <CurrencyFormate
        decimalScale={2}
        value={0}
        displayType={"text"}
        thousandSeparator={true}
        prefix={"$"}
      />
      <button>Proceed to Checkout</button>
    </div>
  );
}

export default Subtotal;
